import './App.css';
import { BrowserRouter, Routes, Route } from "react-router-dom";
import Login from "./Components/Login";
import Registration from "./Components/Register";
import Home from "./Pages/Home";
import Navbar from "./Components/Navbar";
import Account from "./Pages/User/Account";
import Song from "./Pages/Song/AddPage"
import ListSong from "./Pages/Song/ListSong";
import EditSong from "./Pages/Song/EditSong";
import SearchPage from "./Pages/Search";
import Profile from "./Pages/User/Profile";
import AudioPlayer from "./Audio/AudioPlayer";
import AddAlbum from "./Pages/Album/AddAlbum";
import ListAlbum from "./Pages/Album/ListAlbum";
import EditAlbum from "./Pages/Album/EditAlbum";
import {useState} from "react";
function App() {
    const [currentTrack, setCurrentTrack] = useState({});
    const [isPlaying, setIsPlaying] = useState(false);
    return (
        <BrowserRouter>
            <Navbar/>
            <Routes>
                <Route path="/" element={<Home />} />
                <Route path="/login" element={<Login />} />
                <Route path="/register" element={<Registration />} />
                {/*<Route path="/Account" element={<Account/>}/>*/}
                <Route path="/Song" element={<Song/>}/>
                <ListSong onTrackChange={setCurrentTrack} onPlayPauseChange={setIsPlaying} />
                <Route path="/EditSong/:songId" element={<EditSong />} />
                <Route path="/search" element={<SearchPage />} />
                <Route path="/Profile" element={<Profile/>} />
                <Route path="/AddAlbum" element={<AddAlbum/>}/>
                <Route path="/ListAlbum" element={<ListAlbum/>}/>
                <Route path="/EditAlbum/:albumId" element={<EditAlbum />} />
            </Routes>
            <AudioPlayer track={currentTrack} isPlaying={isPlaying} onPlayPauseClick={setIsPlaying} />

        </BrowserRouter>
    );
}

export default App;
